import React from "react";
import { Grid, Box, InputLabel, Input } from "@material-ui/core";

export default function InputForm(props) {
  return (
    <Grid item xs={12}>
      <Box>
        <InputLabel sx={{ color: "#999" }}>{props.label}</InputLabel>
        <Input
          type="text"
          className="member-input form-control  shadow-none"
          placeholder={
            props.place ? props.place : "Customize your Personal Invite Code"
          }
        />
        <Box className="form-text color-orange font-ubun">
          PLEASE NOTE: Once you save the code, it can't be changed later, so
          please make sure it's what you want
        </Box>
      </Box>
    </Grid>
  );
}
